                new TextChunk({
                  wordWidth: font.stringWidth(subword, fontSize),
                  spaceWidth, word: subword,
                  font, fontSize, color, decoration,
                  link, destination, goTo
                })
              )
              offsetWidth -= w.width
              this._spaceLeft -= offsetWidth

              nextWord = word.slice(i)
              word = null

              break
            }
          }
        }

