        if (!postponeLinebreak && word && (this._spaceLeft - offsetWidth) >= 0) {
          this._line.push(
            new TextChunk({
              wordWidth, spaceWidth, word, font, fontSize,
              color, decoration,
              link, destination, goTo
            })
          )
          this._spaceLeft -= offsetWidth
          word = null
        }

        // render line
        let left = this._cursor.x

        // calc max line height
        let height = 0
        let descent = 0

